      out.write("                                    <hr>\n");
      out.write("                                    <div class=\"post-content\">\n");
      out.write("                                        <p>DevOps has significant importance to any company delivering software or technical services today.Defining DevOps is trickier than you would think, primarily because of its wide usage. It is essentially shorthand, and nothing more than that, for a lean approach to software delivery.</p>\n");
      out.write("                                        <br><small><small><a href=\"#\" style=\"text-decoration:none; color:grey;\"><i><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i> 12 minutes ago</i></a></small></small>\n");
