      out.write("                                        <a href=\"#\">\n");
      out.write("                                            <img class=\"media-object img-circle\" src=\"https://lut.im/yR07xwobAA/bZpvdTZmBBTZDJDd.png\" width=\"35px\" height=\"35px\" style=\"margin-right:8px; margin-top:-5px;\">\n");
      out.write("                                        </a>\n");
      out.write("                                    </div>\n");
      out.write("                                    <h4><a href=\"#\" style=\"text-decoration:none;\"><strong>Mi Chleen</strong></a></h4>\n");
      out.write("                                    <hr>\n");
      out.write("                                    <div class=\"post-content\">\n");
      out.write("                                        <p>The secret to DevOps maturity is not technology or process, but people. It takes engaged leadership and all for one cooperation to achieve the kind of results that lead companies to superior IT performance. High-performing DevOps teams can recover 168 times faster from failures and have 60 times fewer failures due to changes, according to the 2015 State of DevOps Report by Puppet Labs. High-performing teams also release code at significantly increasing velocity as their teams grow in size, approaching three deploys per day per developer, for teams of around 1000 developers.</p>\n");
      out.write("                                        <br><small><small><a href=\"#\" style=\"text-decoration:none; color:grey;\"><i><i class=\"fa fa-clock-o\" aria-hidden=\"true\"></i> 9 minutes ago</i></a></small></small>\n");
