      out.write("</strong></a></h4>\n");
      out.write("                                    <hr>\n");
      out.write("                                    <div class=\"post-content\">\n");
      out.write("                                        <p>At a time when the speed of application development is vital to commercial success, the DevOps methodology based on communication, collaboration, integration and automation has become one of the biggest IT moves around. However, it is more than just a business philosophy;to do it right requires genuine infrastructure investment and development.</p>\n");
